import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <img className="fetal" src="https://i.ibb.co/7n2CFX5/monica-fetal.jpg" alt="monica-fetal" border="0"/>
        <p>
          Your stuff will go here. (Update)
        </p>
      </header>
    </div>
  );
}

export default App;
